import React from 'react';
import { Button, Typography } from '@material-ui/core';
import './App.css';
import { makeStyles } from '@material-ui/core/styles';
import { MemoryRouter as Router } from 'react-router';
import { Link as RouterLink } from 'react-router-dom';

const useStyles = makeStyles({
  root: {
    backgroundColor: 'red',
    color: props => props.color,
  },
  style1: {
    fontStyle: 'oblique'
  },
});

const LinkBehavior = React.forwardRef((props, ref) => (
  <RouterLink ref={ref} to="/Job_Postings" {...props} />
));

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <center><Typography variant="h2" gutterBottom className = {useStyles.style1}> Welcome to Phuyel Employment Agency! </Typography> </center>
      </header>
      <Router></Router>
      <Button fullWidth variant="outlined" color="secondary" > Explore Jobs </Button>
      <Button fullWidth variant="outlined" color="primary"> Post Job Openings </Button>
    </div>
  );
}


export default App;
